import React from "react";

const Dashboard = () => {
  // Placeholder data for 10 items
  const placeholderDetections = Array.from({ length: 10 }, (_, index) => ({
    id: index + 1,
    label: "Bear",
    timestamp: `April ${10 - index}, 2025 - ${9 + index}:00 AM`,
    image: "https://via.placeholder.com/200x120.png?text=Detection"
  }));

  return (
    <div style={{ backgroundColor: "#323232", minHeight: "100vh", padding: "2rem", color: "white" }}>
      <h2 className="text-center mb-4" style={{ color: "#ffd400" }}>Detections</h2>
      <div className="container">
        <div className="row">
          {placeholderDetections.map((detection) => (
            <div key={detection.id} className="col-md-6 mb-4">
              <div className="d-flex align-items-center bg-dark p-3 rounded" style={{ boxShadow: "0 0 10px rgba(0,0,0,0.4)" }}>
                <img
                  src={detection.image}
                  alt={`Detection ${detection.id}`}
                  style={{ width: "180px", height: "auto", borderRadius: "15px", marginRight: "20px" }}
                />
                <div>
                  <h5 style={{ color: "#ffd400", marginBottom: "8px" }}>{detection.label}</h5>
                  <p className="mb-0 text-white-50" style={{ fontSize: "0.9rem" }}>{detection.timestamp}</p>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
